import './TodoItem.css'

export default function TodoItem({todo, onDelete, onClick }) {

  return (
    <li style={{ listStyleType: "none" }} onClick={() => onClick(todo.id)} className={'todo-item ' + todo.isDone ? 'todo-item-done' : ''}>
      Task: {todo.text}
      <button onClick={() => onDelete(todo.id)}>DELETE</button>
    </li>
  );
}
